import React from "react";
import testPdf from "../../Resume.pdf";

export default function Resume() {
    return (
        <div>
            <iframe src={`${testPdf}#view=fitH`} title="testPdf" height="100%" width="100%" />
            <iframe src="https://drive.google.com/file/d/1PER45bqKu2atGye-oB6Ub8nSVE3nE7b1/view?usp=share_linkL&embedded=true" frameborder="0" height="500px" width="100%"></iframe>"
        </div>
    )
}
